import logo from './logo.svg';
// import './App.css';
import { BrowserRouter as Router, Routes, Route, Outlet, NavLink } from 'react-router-dom';
import Home from './pages/Home';
import Education from './pages/Education';

const App = () => {
  return (
    <Router>
      <div className='container mx-auto p-4'>
        <nav className='bg-gray-800 p-4'>
          <ul className='flex space-x-4 text-white'>
            <li>
              <NavLink to="/" exact className="hover:text-gray-300 font-bold hover:underline text-blue-400" activeClassName="text-yellow-500">Home</NavLink>
            </li>
            <li>
              <NavLink to="/education" className="hover:text-gray-300 font-bold hover:underline text-blue-400" activeClassName="text-yellow-500">Education</NavLink>
            </li>
          </ul>
        </nav>
      </div>

        <hr />
        <Outlet />
        <Routes>
          <Route exact path="/" element={Home} />
          <Route path="/education" element={Education} />
        </Routes>
    </Router>
  );
};

export default App;
